import React, { Component } from 'react';

class Maps extends Component{

    componentDidMount() {

    }

    renderMap = () => {
        loadScripts("https://maps.googleapis.com/maps/api/js?key=AIzaSyArmx4aUwMvXWfL4poeST8z1yq27Ui1j98&callback=initMap")
    }

    initMap = () => {
        var map = new window.google.maps.Map(document.getElementById('map'), {
          center: {lat: -34.397, lng: 150.644},
          zoom: 6
        });
    }

    render() {
        return(
            <div id="map">
            </div>
        )
    }
}

